import React, { useEffect, useState } from "react";
import { Routes, Route, Navigate } from "react-router-dom";

import Navbar from "./components/Navbar";
import Footer from "./components/Footer";

import Home from "./pages/Home";
import About from "./pages/About";
import Shop from "./pages/Shop";
import Contact from "./pages/Contact";
import Repair from "./pages/Repair";
import Login from "./pages/Login";
import Signup from "./pages/Signup";

import AdminLayout from "./admin/AdminLayout";
import AdminHome from "./admin/AdminHome";
import Users from "./admin/Users";
import Admins from "./admin/Admins";
import Messages from "./admin/Messages";
import Repairs from "./admin/Repairs";
import Categories from "./admin/Categories";
import Products from "./admin/Products";

export default function App() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const saved = localStorage.getItem("loggedUser");
    if (saved) setUser(JSON.parse(saved));
  }, []);

  const logout = () => {
    localStorage.removeItem("loggedUser");
    setUser(null);
  };

  const isAdmin = user?.role === "admin";

  return (
    <>
      <Navbar user={user} logout={logout} />

      <Routes>
        {/* Public */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/shop" element={<Shop />} />

        {/* Auth */}
        <Route path="/login" element={<Login setUser={setUser} />} />
        <Route path="/signup" element={<Signup />} />

        {/* Protected user pages */}
        <Route path="/contact" element={user ? <Contact user={user} /> : <Navigate to="/login" />} />
        <Route path="/repair" element={user ? <Repair user={user} /> : <Navigate to="/login" />} />

        {/* Admin */}
        <Route path="/admin" element={isAdmin ? <AdminLayout /> : <Navigate to="/login" />}>
          <Route index element={<AdminHome />} />
          <Route path="users" element={<Users />} />
          <Route path="admins" element={<Admins />} />
          <Route path="messages" element={<Messages />} />
          <Route path="repairs" element={<Repairs />} />
          <Route path="categories" element={<Categories />} />
          <Route path="products" element={<Products />} />
        </Route>

        <Route path="*" element={<Navigate to="/" />} />
      </Routes>

      <Footer />
    </>
  );
}
